import './App.css';
import React, { useState } from "react";
import { Paper, Grid, Button, Drawer, List, ListItem, Typography, IconButton } from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import '@fontsource/roboto';
import lybLogo from "./lybLogo2.png";

import About from "./components/About";


function App() {

  const [openNav, setOpenNav] = useState(false);
  const [pageSelect, setPageSelect] = useState("home")

  const openDrawer = (e) => {
    e.preventDefault();
    setOpenNav(!openNav);
    console.log(openNav);
  }

  const openPage = (e, page) => {
    e.preventDefault();
    setPageSelect(page);
    setOpenNav(false)
    console.log(page);
  }

  const page = ["Contact", "About", "Prenatal", "Labor and Birth", "Newborn"]

  const style = {
    page: {
      marginTop: "5%",
      marginBottom: "5%",
      marginLeft: "3%",
      marginRight: "3%"
    },
    page1: {
      paddingTop: "5%", 
      paddingBottom: "5%",
      paddingRight: "5%",
      paddingLeft: "5%", 
      backgroundColor: "#FFF0F6"
    },
    page2: {
      paddingTop: "5%", 
      paddingBottom: "5%", 
      paddingRight: "5%",
      paddingLeft: "5%", 
      backgroundColor: "#FFEBF3"
    },
    page3: {
      paddingTop: "5%", 
      paddingBottom: "5%", 
      paddingRight: "5%",
      paddingLeft: "5%", 
      backgroundColor: "#FFE3EE"
    },
    page4: {
      paddingTop: "5%", 
      paddingBottom: "5%", 
      paddingRight: "5%",
      paddingLeft: "5%", 
      backgroundColor: "#FCDCE9"
    },
    page5: {
      paddingTop: "5%", 
      paddingBottom: "5%", 
      paddingRight: "5%",
      paddingLeft: "5%", 
      backgroundColor: "#FFD9E8"
    }
  }
  return (
    <div className="App">
      <Grid container style={{ paddingTop: "8%" }}>
        <Grid md="1" xs="1">
          <IconButton onClick={openDrawer}>
              <MenuIcon />
          </IconButton>
        </Grid>

        <Grid md="10" xs="10">
          <img src={lybLogo} style={{ width: "55%", height: "auto", paddingLeft: "8%", paddingRight: "8%" }}/>
          <Grid item md="12" xs="12" style={style.page}>
            <Paper style={style.page1}>
              <About />
            </Paper>
          </Grid>
          <Grid item md="12" xs="12" style={style.page}>
            <Paper style={style.page2}>
              <About />
            </Paper>
          </Grid>
          <Grid item md="12" xs="12" style={style.page}>
            <Paper style={style.page3}>
              <About />
            </Paper>
          </Grid>
          <Grid item md="12" xs="12" style={style.page}>
            <Paper style={style.page4}>
              <About />
            </Paper>
          </Grid>
          <Grid item md="12" xs="12" style={style.page}>
            <Paper style={style.page5}>
              <About />
            </Paper>
          </Grid>
        </Grid>

        <Grid md="1" xs="1">

        </Grid>
      </Grid>


      <Drawer anchor="left" open={openNav}>
        <Grid container style={{ paddingTop: "20%" }}>
          <List>
            <IconButton onClick={openDrawer}>
                <ChevronLeftIcon/>
            </IconButton>
            {page.map((item) => (
              <ListItem> 
                <Button onClick={e => openPage(e, item)}>{item}</Button>
              </ListItem>
            ))}
          </List>
        </Grid>
      </Drawer>
    </div>
  );
}

export default App;
